import React, { useState, useEffect } from 'react';
import './App.css';
import { AttackPage } from '.' 

function App() {
  const [initalData, setInitialData] = useState([{}])

  useEffect(()=> {
    fetch('/api').then(
      response => response.json()
    ).then(data => setInitialData(data))
  }, []);
  return (
    <div className="App">
      <h1>{initalData.title}</h1>
    </div>
  );
}

export default App;
